import Link from 'next/link';

const Navigation = () => (
    <nav id="nav">
    <ul className="container">
      <li><a href="#top">Inicio</a></li>
      <li><a href="#work">Trabajo</a></li>
      <li><a href="#portfolio">Portfolio</a></li>
      <li><a href="#contact">Contacto</a></li>
    </ul>
  </nav>
)

export default Navigation;
